import React from "react";
import { Link, Route, Routes } from 'react-router-dom';

class BrandCatalog extends React.Component {
    render() {
        const { chosenBrand } = this.props;
        return (
            <section>
                {chosenBrand.models ?
                    chosenBrand.models.map((model, i) => (
                        <Link to={`/catalog/${chosenBrand.name}/${model}`} key={i}>{model}</Link>
                    ))
                    :
                    <Routes>
                        <Route path={`/${chosenBrand.name}`} />
                    </Routes>
                }
            </section>
        )
    }
}

export default BrandCatalog;
